import React from 'react';


const Summary = (props) => {
  return (
    <div>
      <Example details={props.exampleDetails} />
      <PersonalInfo 
        name={props.personalInfo.name} 
        age={props.personalInfo.age} 
        occupation={props.personalInfo.occupation} 
      />
    </div>
  );
};




function App() {
  const personalInfo = {
    name: "John Doe",
    age: 30,
    occupation: "Software Developer"
  };

  return (
    <div>
      <Example details="Kibaki" />
      <Example details="Mwenyewe" />
      <Example details="No details provided" />

      <PersonalInfo name="Jane Doe" age={28} occupation="Designer" />

      <Summary 
        exampleDetails="Summary Example Details" 
        personalInfo={personalInfo} 
      />
    </div>
  );
}

export default App;
